import React from "react";
import './Men.css';
import HomePage from "./HomePage";


function Men(){
    return(
        <>
       <HomePage/>
       <div className="men-section">
         <div className="container">
            <div className="collection-heading">
              SHOP BY FANDOM 
            </div>
            <div className="men-collection-card-container">
            <div className="man-collection-img-card">
            <img src="./img/men collection1.webp" alt="error" />
            </div>

            </div>

         </div>

       </div>
        </>
    );

  
}
export default Men ;
